import React from 'react';
import '../styles/Series.css';
import { Link, useParams } from "react-router-dom";


export default function BCSEpisodes(props) {
    const BCSList = props.BCSList;
    var {season} = useParams();

    var chaptersPerSeason = {};
    for (var key in BCSList) {
        if (BCSList[key].season === season) {
            chaptersPerSeason[BCSList[key].episode] = BCSList[key]
        } 
    }

    console.log(chaptersPerSeason);

    var keys = [];
    for (var key2 in chaptersPerSeason) {
        keys.push(key2);
    }
    return (
        <div id="info">
            <Link to={`/breaking-bad/temporada/${props.value}`} className="temporada">
                <h2> Temporada { props.value } </h2>
            </Link>
            <div id="capitulos">
                {keys.map((value, id) => {
                    return (<h4>  Episodio {value}: { props.CPS[value]['title'] } </h4>)
                })}
            </div>
        </div>
    );
}
